import styled from 'styled-components';

const InputCxBx = styled.input.attrs({ type: "checkbox" })`
  background: transparent;    
  text-align: center;
  border-radius: 50px;
  width: 18px;
  height: 18px;
  cursor: pointer;
`;

export default InputCxBx;
